import Link from 'next/link'
import Head from 'next/head'
import Router from 'next/router'

export default function MainLAyout() {
  return (
    <div className="container">
        <Head>
            <title>Create Next App</title>
            <link rel="icon" href="/favicon.ico" />
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
            <link rel="stylesheet"href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"/>
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
            <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/js/bootstrap.min.js"></script>
        </Head>

        
        <div className="row">
            <div className="col-sm-2">
                <div className="logo"><a className="colLink" href="">Logo </a> </div>
                <div className="colItem Tel" >
                <i class="fab fa-telegram"></i>
                    <a className="colLink" href="" >Orders</a>
                    </div>
                <div className="colItem">
                    <a className="colLink" href="">A link</a>
                </div>
        
            </div>
            {/* main part settings */}
            <div className="col-sm-9">
                <h1>Settings</h1>
                <div className="row rowTop">  
                    <div className="col-sm-3">Status</div>
                    <div className="col-sm-9">Active</div>
                </div>

                <div className="row rowTop">  
                    <div className="col-sm-3">Название</div>
                    <input className="form-control col-sm-9" type="text" placeholder="Default input"/>
                </div>

                
                <div className="row rowTop">
                    <div className="col-sm-3">Telegram-токен бота</div>
                    <input className="form-control col-sm-9" type="text" placeholder="Default input"/>
                    <small id="HelpBlock" class="form-text text-muted">Telegram-токен бота</small>
                </div>
            </div>
        
        </div>


        <style jsx global>{`
            .container {
            left:0;
            position:relative;
            padding:0;
            margin:0;
            }
            .col-sm-2{
                height:100vh;
                background-color:#333;
            }
            .logo{
                margin-left:10px;
                padding-top:30px;
            }
            .fab{
                font-family:FontAwesome;
            }
            .colLink{
                font-size:16px;
                color:white;
            }
            .Tel{
                margin:20px 0;
            }
            .colItem{
                width:100%;
                padding-left:10px;
                position:relative;
            }
            .colItem:hover{
                background-color:#808080;
            }
            .colItem:hover .colLink{
                text-decoration:none;
                color:white;
            }
            //main part settings 
            .rowTop{
                margin-top:20px;
            }
        `}</style>

        <style jsx global>{`
            html,
            body {
            padding: 0;
            margin: 0;
            font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
                Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
                sans-serif;
            }

            * {
            box-sizing: border-box;
            }
        `}</style>
    </div>
  )
}
